def uniquePathsIII(grid):
    (m, n) = (len(grid), len(grid[0]))
    (ans, empties, x, y, dx, dy) = (1, 0, 0, 0, [-1, 0, 1, 0], [0, 1, 0, -1])

    def dfs(x, y, empties):
        nonlocal ans
        if not (0 <= x < m and 0 <= y < n) or grid[x][y] < 0:
            return
        elif grid[x][y] == 2:
            ans += empties == 0
        else:
            (temp, grid[x][y]) = (grid[x][y], -2)
            for k in range(4):
                dfs(x + dx[k], y + dy[k], empties - (temp == 0))
            grid[x][y] = temp
    for i in range(m):
        for j in range(n):
            if grid[i][j] == 1:
                (x, y) = (i, j)
            elif grid[i][j] == 0:
                empties += 1
            elif grid[i][j] == 2:
                empties -= 1
    dfs(x, y, empties)
    return ans

